const App = () => {

  const [count, setCount] = useState(0);
  
  const InNum = () =>{
    setCount(count +1)
  }
  return(
    <>
    <div>
    <h1>{count}</h1>
    <button onClick={InNum}>Click Me</button>
    </div>
    </>
    );
  };
  export default App;
